import classes from './BoardItem.module.css';

function BoardItem({board}) {
    return(
        <article className={classes.event}>
        <h1>{board.title}</h1>
        <p>{board.author}</p>
        <p>{board.content}</p>
        <menu className={classes.actions}>
          <Link to="edit">Edit</Link>
          <button onClick={startDeleteHandler}>Delete</button>
        </menu>
      </article> 
    )
}
